import React from "react";
import "../../styles/Navbar.css";

function Navbar() {

return(<nav className="navbar"><ul><li className="navbar-brand"><a href="/">Clicky Game</a>
</li><li className="navbar-text">Click an image to begin!</li><span className="navbar-text">Score: 0 | Top Score: 0</span></ul></nav>);

}

export default Navbar;
